[[Image:P culture.svg|right|150px]] '''''Please categorize images into subcategories listed below''''' * '''''Playwrights''''', '''''directors''''' and '''''actors''''' are collected under [[:Category:Theatrical occupations|Professions]]. * Images relating to '''''plays''''', '''''dramas''''' and the '''''written word''''' are collected under the [[:Category:Drama|Drama]] subcategory. * Images relating to '''''types of practical production''''' are collected under the [[:Category:Theatrical genres|Theatrical genres]] subcategory. * Pictures of '''''specific productions''''' should be categorized under relevant [[:Category:Theatre by country|Theatre by country]] category.
